pragma solidity ^0.8.0;
 contract RandomUintGen {
    uint public randNonce;
    uint public random; 

    function incRandNonce() internal {
        randNonce++;
    }

     function randomGen () internal returns (uint) {
        incRandNonce();
        return uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, randNonce)));
     }

     
 }

